import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import Car from './App.js';

class App extends React.Component {

    show() {
    }
    render() {

        return (
            <div>
                <ul>
                <button onClick={this.show} value="1">Click Me</button>
                <button onClick={this.show} value="2">Click Me</button>
                <button onClick={this.show} value="3">Click Me</button>
                </ul>
            </div>
        );
    }
}
ReactDOM.render(<App />, document.getElementById('root'));
